import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import './ChildMatchComponent.css';

class ChildMatchComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            match: props.match
        };
    }

    render() {
        //TODO Remove Placeholder For Whether Won
        let { match } = this.props;
        return (
            <React.Fragment>
                <Container className="matchItem">
                    <Row>
                        <Col xs="4">
                            <h4>Team {match.robot.teamNumber}</h4>
                        </Col>
                        <Col xs="4" style={{textAlign: 'center'}}>
                            <h4> Match {match.matchNumber}</h4>
                        </Col>
                        <Col xs="4" style={{textAlign: 'end'}}>
                        <h4 style={{color: 'green'}}>Won!</h4>
                        </Col>
                    </Row>
                    <Row style={{paddingTop: '1em'}}>
                        <Col className="mx-auto">
                            <div style={{display: 'flex', justifyContent: "center"}}>
                                <Button>See Team Statisctics</Button>
                                <Button>See Match Performance</Button>
                            </div>
                        </Col>
                    </Row>
                </Container>
            </React.Fragment>
        );
    }
}

export default ChildMatchComponent;
